define("",["lib_cmd/vue-cmd"],function(require,exports,module){var e=require("lib_cmd/vue-cmd");e.component("v-select-admin",{props:["market","park","selectsubset"],data:function(){return{_id:1,state:!1,selectdata:function(){var e=null;return $.ajax({url:"/market/brief",dataType:"json",async:!1,type:"GET",success:function(t){e=t.content},error:function(e){alert(e.msg)}}),e}()}},template:'<div class="form-group">                                <label class="col-md-3 control-label" >隶属于市场所: <span class="text-danger">*</span></label>                                 <div class="col-md-7">                                         <select class="form-control"   id="select_market" name="market" @change="selectChange($event)">                                             <option value="0">请选择</option>                                             <option v-for="item in selectdata" :selected="market==item.id?true:false" :value="item.id">{{item.name}}</option>                                         </select>                                 </div>                               </div>                                <div class="form-group">                                  <label class="col-md-3 control-label" >隶属于园区: <span class="text-danger">*</span></label>                                         <div class="col-md-7" >                                           <select class="form-control" id="select_park" name="park" @change="sendVal($event)">                                                 <option value="0">请选择</option>                                                 <option   v-for="item in selectsubset" :selected="park==item.id?true:false" :value="item.id">{{item.name}}</option>                                           </select>                                  </div>                                </div>',methods:{selectChange:function(e){var t=this;if("0"==$(e.target).val())this._id=1,this.state=!1;else{this.state=!0,this._id=$(e.target).val();var t=this;console.log(this._id),$.ajax({url:"/park/briefall/"+t._id,dataType:"json",async:!1,type:"GET",success:function(e){console.log(JSON.stringify(e.content)),t.selectsubset=e.content},error:function(e){alert(e.msg)}})}},sendVal:function(e){var t=$(e.target).val();console.log(t),this.$dispatch("send-select-admin",t)}}})});